commit.message:
[eslint config] [base] [patch] `newline-per-chained-call`: bump the limit to 4.

Specifically, this is to allow this frequent pattern:
```js
$.ajax({
  …
}).done(() => {
  …
}).fail(() => {
  …
}).always(() => {
  …
});
```

